		<script type="application/javascript">

        width: 100%;
        height: 100%;
        max-height: 100%;

        background-color: black;
        font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Helvetica, Arial, sans-serif;
      }
      #app {
        height: 100%;
        display: flex;
        justify-content: center;
      }
      .idle #app {
        opacity: 0.2;
      }
      #splash {
        position: absolute;
        width: 100%;
        height: 100%;
        z-index: 1;
        display: flex;
        align-items: center;
        justify-content: center;
        background-color: black;
        opacity: 1;
        transition: opacity 250ms;
      }
      #splash.hide {
        pointer-events: none;
        opacity: 0;
      }
      #splash-logo {
        height: 100%;
        width: 50%;
        max-width: 300px;
        background-image: url("assets/starlink-logo-white.png");
        background-repeat: no-repeat;
        background-position: center center;
        background-size: contain;
      }
		</style>

		<script type="text/javascript">
			function dishyIsReachable() {
				if (window.location.origin !== "http://dishy.starlink.com") {
					window.location =
					"http://dishy.starlink.com" +
					window.location.pathname +
					window.location.search +
					window.location.hash;
				}
			}
		</script>
